import React from 'react';
import '.InfoCard.css';

const InfoCard = ({ title, image, description, bioChemicals, benefits }) => {
  return (
    <div className="info-card">
      <h2>{title}</h2>
      <img src={image} alt={title} />
      <p>{description}</p>

      <h4>Bio-Chemicals:</h4>
      <ul>
        {bioChemicals.map((chemical, index) => (
          <li key={index}>{chemical}</li>
        ))}
      </ul>

      <h4>Benefits:</h4>
      <ul>
        {benefits.map((benefit, index) => (
          <li key={index}>{benefit}</li>
        ))}
      </ul>
    </div>
  );
};

export default InfoCard;
